function oliverSVG(v) {
    const oliverBody = v.toLowerCase().includes("doctor") ? oliverDrBase : v.toLowerCase().includes("professor") ? oliverProfessorBase : oliverBase;
    return `
        <svg id="oliver" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 357 357" class="visemeClass" >
            ${oliverDefs}
            ${oliverBody}
            ${oliverMouth}
            ${oliverGlasses}
            ${v.toLowerCase().includes("christmas") ? christmasCap : logoHair}
            ${oliverEyeShapes}
        </svg>
    `;
}
